import Book from "./components/Book";
import { IBook } from "./interfaces/IBook";

function App() {
  return (
    <div className="container">
      <div className="books-container">
        {books.map((book: IBook) => (
          <Book
            key={book?.id}
            id={book?.id}
            title={book?.title}
            author_name={book?.author_name}
          />
        ))}
      </div>
    </div>
  );
}

export default App;
